import React, { useState, useEffect } from "react";
import { Link } from "react-scroll";
import logo from "../assets/img/logo.png";
import {
  AiOutlineHolder,
  AiOutlineQrcode,
  AiTwotoneAlert,
} from "react-icons/ai";

export default function Header() {
  const [toggle, setToggle] = useState(false);

  const toggleMenu = () => {
    console.log("Toggle button clicked");
    setToggle(!toggle);
  };

  useEffect(() => {
    const closeMenuOnClickOutside = (event) => {
      if (toggle && !event.target.closest(".mobile")) {
        setToggle(false);
      }
    };

    document.addEventListener("click", closeMenuOnClickOutside);

    return () => {
      document.removeEventListener("click", closeMenuOnClickOutside);
    };
  }, [toggle]);

  return (
    <div className="header-container sticky top-0 flex justify-between text-white duration-300 shadow-2xl rounded-br-3xl rounded-bl-3xl bg-[#282847d0] max-w-[1230px] mx-auto flex-row p-3">
      <a href="/">
        <div className="logo border-[#61dafb] border-2 rounded-lg">
          <img src={logo} className="h-[50px]" alt="Logo" />
        </div>
      </a>

      <div className="justify-center items-center translate-y-5">
        <AiTwotoneAlert
          className="duration-300 ease-in-out text-[30px] rounded-3xl"
          id="toggle"
        />
      </div>
      <div className="menu justify-center items-center flex">
        <ul className="hidden md:flex flex-row gap-3 text-white justify-center items-center">
          <li className="menu-item hover:border-b-2 border-[#61dafb] p-1 hover:scale-110 m-2 ease-in-out duration-200">
            <Link
              activeClass="active"
              to="about"
              spy={true}
              smooth={true}
              offset={-70}
              duration={500}
            >
              <span className="text-[#61dafb] font-bold">1. </span>About
            </Link>
          </li>
          <li className="menu-item hover:border-b-2 border-[#61dafb] p-1 hover:scale-110 m-2 ease-in-out duration-200">
            <Link
              activeClass="active"
              to="experience"
              spy={true}
              smooth={true}
              offset={-70}
              duration={500}
            >
              <span className="text-[#61dafb] font-bold">2. </span>Experience
            </Link>
          </li>
          <li className="menu-item hover:border-b-2 border-[#61dafb] p-1 hover:scale-110 m-2 ease-in-out duration-200">
            <Link
              activeClass="active"
              to="projects"
              spy={true}
              smooth={true}
              offset={-70}
              duration={500}
            >
              <span className="text-[#61dafb] font-bold">3. </span>Projects
            </Link>
          </li>
          <li className="menu-item hover:border-b-2 border-[#61dafb] p-1 hover:scale-110 m-2 ease-in-out duration-200">
            <Link
              activeClass="active"
              to="contact"
              spy={true}
              smooth={true}
              offset={-70}
              duration={500}
            >
              <span className="text-[#61dafb] font-bold">4. </span>Contact
            </Link>
          </li>
          <li className="menu-item hover:border-b-2 border-[#61dafb] p-1 border-[#61dafb] m-2 border-2 hover:text-black hover:bg-[#61dafb] rounded-xl p-2 hover:scale-110 ease-in-out duration-200">
            <a href="https://drive.google.com/file/d/1-yEFuGpNKs_I4T8jfGcyjwh7UFCYblhX/view?usp=sharing">
              Resume
            </a>
          </li>
        </ul>

        <div className={`mobile z-999 ${toggle ? "right-0" : "right-[100%]"}`}>
          <ul
            className={`fixed md:hidden top-20 z-999 bg-[#61dafb] w-[100%] text-black font-bold ${
              toggle
                ? "right-0 transition-right duration-300"
                : "right-[-100%] transition-right duration-300"
            } h-[100%] gap-3 text-[white] justify-center items-center`}
          >
            <li className="menu-item hover:border-b-2 border-[#61dafb] p-1 hover:scale-110 m-2 ease-in-out duration-200">
              <Link
                activeClass="active"
                to="about"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
              >
                <span className="text-[#61dafb] font-bold">1. </span>About
              </Link>
            </li>
            <li className="menu-item hover:border-b-2 border-[#61dafb] p-1 hover:scale-110 m-2 ease-in-out duration-200">
              <Link
                activeClass="active"
                to="experience"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
              >
                <span className="text-[#61dafb] font-bold">2. </span>Experience
              </Link>
            </li>
            <li className="menu-item hover:border-b-2 border-[#61dafb] p-1 hover:scale-110 m-2 ease-in-out duration-200">
              <Link
                activeClass="active"
                to="projects"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
              >
                <span className="text-[#61dafb] font-bold">3. </span>Projects
              </Link>
            </li>
            <li className="menu-item hover:border-b-2 border-[#61dafb] p-1 hover:scale-110 m-2 ease-in-out duration-200">
              <Link
                activeClass="active"
                to="contact"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
              >
                <span className="text-[#61dafb] font-bold">4. </span>Contact
              </Link>
            </li>
            <li className="menu-item hover:border-b-2 border-[#61dafb] p-1 border-[#61dafb] m-2 border-2 hover:text-black hover:bg-[#61dafb] rounded-xl p-2 hover:scale-110 ease-in-out duration-200">
              <a href="https://drive.google.com/file/d/1-yEFuGpNKs_I4T8jfGcyjwh7UFCYblhX/view?usp=sharing">
                Resume
              </a>
            </li>
          </ul>
        </div>

        <div className="md:hidden">
          {toggle ? (
            <AiOutlineHolder
              onClick={toggleMenu}
              className="text-[#61dafb] text-3xl cursor-pointer block"
            />
          ) : (
            <AiOutlineQrcode
              onClick={toggleMenu}
              className="text-[#61dafb] text-3xl cursor-pointer block"
            />
          )}
        </div>
      </div>
    </div>
  );
}
